import React, { useState , useEffect, useContext} from 'react';
import ToDoContext from './context';
import {TextField, Grid, FormHelperText} from '@material-ui/core';

const Content = () => {
  const {todoContext, state} = useContext(ToDoContext)
  useEffect(() => {
    fetch("api/todos", {
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }})
      .then((response) => response.json())
      .then((json) => todoContext.listTodo(json))
  }, [])
return (
<div>
  <h1>hello</h1>
  {console.log(state.todosFcontext)}
  <Grid item xs={3}>
    <TextField
                id="standard-select-currency-native"
                select
                fullWidth
                size= "small"
                labelPlacement="top"
                variant="outlined"
                SelectProps={{
                    native: true,
                }}
                >
                {state.todosFcontext.map((todo) => (
                    <div key={todo.name} value={todo.name}>
                    </div>
                ))}
            </TextField>
            <FormHelperText >User</FormHelperText>
            {/* className={classes.helperText} */}
    </Grid>
</div>
);
}

export default Content;
